import Layout from '../components/Layout';
import Link from 'next/link';

const PostLink = ({ title, content }) => {
    return (
        <li>
            <Link href={`/post?title=${title}`}>
                <a>{title}</a>
                <a>{content}</a>
            </Link>
        </li>
    );
}

const Index = () => {
    return (
        <Layout>
            <h3>My Blog</h3>
            <ul>
               <PostLink title="「Hello World」表示" content="「Hello World」表示させてみた" />
               <PostLink title="初めてのNextアプリ" content="Blogアプリ実装してみた" /> 
            </ul>
        </Layout>
    );
}

export default Index;
